"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?34/36/35397/abstract/30\">",
"      Foster PP, Butler BD. Decompression to altitude: assumptions, experimental evidence, and future directions. J Appl Physiol 2009; 106:678.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?34/36/35397/abstract/31\">",
"      Klokker M, Vesterhauge S, Jansen EC. Pressure-equalizing earplugs do not prevent barotrauma on descent from 8000 ft cabin altitude. Aviat Space Environ Med 2005; 76:1079.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?34/36/35397/abstract/32\">",
"      Fernau JL, Hirsch BE, Derkay C, et al. Hyperbaric oxygen therapy: effect on middle ear and eustachian tube function. Laryngoscope 1992; 102:48.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?34/36/35397/abstract/33\">",
"      Goplen FK, Gr&oslash;nning M, Aasen T, Nordahl SH. Vestibular effects of diving - a 6-year prospective study. Occup Med (Lond) 2010; 60:43.",
"     </a>",
