var title_f34_36_35403="Rx protocol acute CVS";
var content_f34_36_35403=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F59920&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F59920&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Sample treatment protocol order sheet for a child having an acute attack of CVS",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        In Emergency Department and in-hospital settings, an example of a regimen would include:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Darkened, quiet room, take vital signs every 4-6 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If child is dehydrated, rehydrate with initial intravenous fluid bolus of 10 mL/kg normal 0.9% saline and repeat as clinically necessary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Infuse 10% dextrose 0.45% (half normal) saline solution with potassium chloride as appropriate at 1.5 times maintenance rates",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intravenous ondansetron 0.3 mg/kg/dose every 6 hours x 24 hours (maximum 20 mg per dose)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intravenous lorazepam 0.05 mg/kg/dose every 6 hours x 24 hours (maximum 2 mg per dose)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If child has moderate to severe abdominal pain, intravenous ketorolac 0.5 to 1 mg/kg/dose (maximum 30 mg per dose) every 6 hours x 24 hours (avoid in renal insufficiency or prior to hydration if dehydrated)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Admit child if &gt;5 percent dehydrated, no urine output &gt;12 hours, Na",
"        <sup>",
"         +",
"        </sup>",
"        &lt;130 mEq/L, anion gap &gt;18 mEq/L, or inability to stop emesis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Allow oral fluid intake",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     %: percent.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Li BU, Lefevre F, Chelimsky GG, et al. North American Society for Pediatric Gastroenterology, Hepatology, and Nutrition consensus statement on the diagnosis and management of cyclic vomiting syndrome. J Pediatr Gastroenterol Nutr 2008; 47:379. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
