var title_f34_36_35406="Outcome MI and prior angina";
var content_f34_36_35406=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F61136&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F61136&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 527px\">",
"   <div class=\"ttl\">",
"    In-hospital mortality is lower in patients with angina prior to an acute MI",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 507px; height: 480px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Among patients without a previous myocardial infarction (MI), the overall in-hospital mortality was lower in those with angina prior to the MI compared to those who did not have angina; this was primarily due to a lower incidence of cardiac rupture (top panel). Among patients with a prior MI, the in-hospital mortality was also lower in those with anginal episodes prior to the MI, primarily because of a lower incidence of cardiogenic shock or heart failure (HF) (bottom panel).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Kobayashi, Y, Miyazaki, S, Itoh, A, et al. Am J Cardiol 1998; 81:117.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
