var title_f34_36_35407="Treatment algorithm for nociceptive pain";
var content_f34_36_35407=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F71075&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F71075&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 476px\">",
"   <div class=\"ttl\">",
"    Nociceptive pain: Pharmacologic approach",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 626px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     Risk factors:",
"    </strong>",
"    <br>",
"     <ul>",
"      <li>",
"       Chronic kidney disease, advanced age - avoid NSAIDs and COX-2 inhibitors",
"      </li>",
"      <li>",
"       Peptic ulcer disease, glucocorticoid use - avoid NSAIDs",
"      </li>",
"      <li>",
"       Hepatic disease - avoid NSAIDs, COX-2 inhibitors, and acetaminophen (APAP); use TCAs or duloxetine first line",
"      </li>",
"      <li>",
"       Cardiovascular disease or risk - use lowest effective dose of NSAIDs; in patients who require treatment, suggest naproxen",
"      </li>",
"     </ul>",
"     <div class=\"footnotes\">",
"      NSAID: nonsteroidal anti-inflammatory drug; COX-2: cyclooxygenase 2 inhibitor; APAP: acetaminophen/paracetamol; TCA: tricyclic antidepressant; PPI: proton pump inhibitor.",
"     </div>",
"     <div class=\"reference\">",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
